import React from 'react';
import "./";

const Footer = () => {
    return (
        <div className="footer-container">
            <a href="/" className="footer-link">
                <button className="footer-button primary">Liste des voitures</button>
            </a>
            <a href="/client-list" className="footer-link">
                <button className="footer-button secondary">Liste des clients</button>
            </a>
            <a href="/add-car" className="footer-link">
                <button className="footer-button success">Ajouter une voiture</button>
            </a>
            <a href="/add-client" className="footer-link">
                <button className="footer-button danger">Ajouter un client</button>
            </a>
        </div>
    );
};

export default Footer;
